import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { DataContextProvider } from './appContext'



ReactDOM.render(
  <DataContextProvider>
    <Router>
    <App />
    </Router>
    </DataContextProvider>,
  document.getElementById('root')
);
